/**
 * üá¨üáß User Dashboard Page
 * 
 * üá´üá∑ Page du tableau de bord utilisateur
 */
import React from 'react';
import { Link } from 'react-router-dom';
import { 
  FaChartLine, 
  FaSwimmer, 
  FaCalendarCheck, 
  FaListAlt, 
  FaUserEdit,
  FaRunning,
  FaUpload,
  FaClipboardList,
  FaTrophy,
  FaStopwatch,
  FaRulerHorizontal,
  FaCalendarAlt,
  FaBookOpen,
  FaDumbbell,
  FaVideo,
  FaBolt,
  FaRegClock,
  FaRegLightbulb,
  FaBiking,
  FaTools
} from 'react-icons/fa';
import useAuth from '../../hooks/useAuth';

/**
 * üá¨üáß Quick Access Card Component
 * 
 * üá´üá∑ Composant pour les cartes d'acc√®s rapide
 */
const QuickAccessCard = ({ icon: Icon, title, description, link, color = "primary" }) => (
  <div className="col-md-4 mb-4">
    <div className="card h-100 hover-lift">
      <div className="card-body text-center">
        <div className={`bg-${color}-subtle p-3 rounded-circle d-inline-block mb-3`}>
          <Icon className={`text-${color} fs-2`} />
        </div>
        <h3 className="card-title h5">{title}</h3>
        <p className="card-text text-muted mb-3">{description}</p>
        <Link to={link} className={`btn btn-lg btn-block btn-${color}`}>
         Consulter
        </Link>
      </div>
    </div>
  </div>
);

/**
 * üá¨üáß Library Resource Card Component
 * 
 * üá´üá∑ Composant pour les cartes de ressources de biblioth√®que
 */
const LibraryCard = ({ icon: Icon, title, items, color = "primary" }) => (
  <div className="col-md-6 col-lg-3 mb-4">
    <div className="card h-100 shadow-sm">
      <div className="card-header bg-light p-3">
        <div className="d-flex align-items-center">
          <Icon className={`text-${color} me-2 fs-4`} />
          <h3 className="card-title h5 mb-0">{title}</h3>
        </div>
      </div>
      <div className="card-body">
        <ul className="list-unstyled mb-0">
          {items.map((item, index) => (
            <li key={index} className="mb-2 d-flex align-items-start">
              <span className="me-2">‚Ä¢</span>
              <span>{item}</span>
            </li>
          ))}
        </ul>
      </div>
      <div className="card-footer bg-white border-top-light">

      </div>
    </div>
  </div>
);

/**
 * üá¨üáß Main User Dashboard Page Component
 * 
 * üá´üá∑ Composant principal de la page du tableau de bord utilisateur
 */
const UserDashboardPage = () => {
  /**
   * üá¨üáß Quick Access Card Data
   * 
   * üá´üá∑ Donn√©es des cartes d'acc√®s rapide
   */
  const quickAccessCards = [
    {
      icon: FaSwimmer,
      title: 'S√©ances',
      description: 'G√©rez vos entra√Ænements et suivez vos s√©ances',
      link: '/user/workouts',
      color: 'primary'
    },
    {
      icon: FaCalendarCheck,
      title: 'Programmes d entra√Ænement',
      description: "Consultez et cr√©ez vos plans d'entra√Ænement",
      link: '/user/plans',
      color: 'success'
    },
    {
      icon: FaRunning,
      title: 'Exercices',
      description: 'Biblioth√®que d exercices personnalis√©s',
      link: '/user/exercises',
      color: 'info',
    },
    {
      icon: FaClipboardList,
      title: 'Mes Carnets Mes Entra√Ænements',
      description: 'Organisez vos objectifs et exercices favoris',
      link: '/user/mylists',
      color: 'warning'
    },
    {
      icon: FaUpload,
      title: 'Conseils et ressources',
      description: "Articles, Publications, Infos, News et Plus",
      link: '/articles',
      color: 'danger'
    },
    {
      icon: FaUserEdit,
      title: 'Mon Profil',
      description: 'Modifiez vos informations personnelles',
      link: '/user/profile',
      color: 'secondary'
    }
  ];

  /**
   * üá¨üáß Library Resources Data
   * 
   * üá´üá∑ Donn√©es des ressources de la biblioth√®que
   */
  const libraryResources = [
    {
      icon: FaBookOpen,
      title: "Exercices Techniques",
      items: [
        "Am√©lioration technique des 4 nages",
        "Battements de jambes optimis√©s",
        "Exercices de respiration sp√©cifiques",
        "Mouvements de bras isol√©s"
      ],
      color: "primary"
    },
    {
      icon: FaRegClock,
      title: "Exercices d'Endurance",
      items: [
        "S√©ries longue distance √† allure mod√©r√©e",
        "Entra√Ænements √† rythme variable",
        "Nage continue progressive",
        "S√©ances d'endurance fondamentale"
      ],
      color: "success"
    },
    {
      icon: FaBolt,
      title: "Exercices de Vitesse",
      items: [
        "Sprints courts haute intensit√©",
        "Perfectionnement d√©parts et virages",
        "S√©ries explosives chronom√©tr√©es",
        "Exercices d'acc√©l√©ration progressive"
      ],
      color: "danger"
    },
    {
      icon: FaDumbbell,
      title: "Renforcement Musculaire",
      items: [
        "Exercices avec √©lastiques sp√©cifiques",
        "Circuits de gainage pour nageurs",
        "Musculation adapt√©e √† la natation",
        "Travail des muscles stabilisateurs"
      ],
      color: "info"
    },
    {
      icon: FaSwimmer,
      title: "Programmes D√©butants",
      items: [
        "Initiation aux techniques de base",
        "Progression m√©thodique par niveau",
        "Exercices d'aisance aquatique",
        "Familiarisation avec les 4 nages"
      ],
      color: "warning"
    },
    {
      icon: FaTrophy,
      title: "Programmes Avanc√©s",
      items: [
        "Entra√Ænement fractionn√© haute intensit√©",
        "Pr√©paration sp√©cifique comp√©tition",
        "Perfectionnement technique avanc√©",
        "Optimisation des performances"
      ],
      color: "secondary"
    },
    {
      icon: FaBiking,
      title: "Programmes Sp√©cifiques",
      items: [
        "Pr√©paration triathlon et eau libre",
        "Entra√Ænements par sp√©cialit√©",
        "S√©ances adapt√©es aux masters",
        "Programmes r√©cup√©ration post-blessure"
      ],
      color: "dark"
    },
    {
      icon: FaRegLightbulb,
      title: "Ressources Compl√©mentaires",
      items: [
        "Vid√©os techniques et d√©monstrations",
        "Articles nutrition et r√©cup√©ration",
        "Guides de pr√©paration mentale",
        "Outils de suivi des performances"
      ],
      color: "info"
    }
  ];

  return (
    <>
      <main className="container-fluid py-4">
        {/* üá¨üáß Header Section | üá´üá∑ Section d'en-t√™te */}
        <header className="title-swim">
          <h1>Mon Espace</h1>
