          <div className="row">
            {quickAccessCards.map((card, index) => (
              <QuickAccessCard 
                key={index}
                icon={card.icon}
                title={card.title}
                description={card.description}
                link={card.link}
                color={card.color}
              />
            ))}
          </div>
        </section>



        {/* üá¨üáß Library Resources Section | üá´üá∑ Section des ressources de biblioth√®que */}
        <section className="mb-4">
          <div className="d-flex justify-content-between align-items-center mb-4">
            <h2 className="h3 mb-0">Biblioth√®que d'Entra√Ænement</h2>

          </div>

          <div className="bg-light p-4 rounded-3 mb-4">
            <p className="lead mb-0">
              Une collection compl√®te de ressources pour am√©liorer votre technique, endurance et vitesse en natation - que vous soyez d√©butant ou nageur confirm√©.
            </p>
