          <div className="row">
            {libraryResources.map((resource, index) => (
              <LibraryCard
                key={index}
                icon={resource.icon}
                title={resource.title}
                items={resource.items}
                color={resource.color}
              />
            ))}
          </div>
        </section>
      </main>
    </>
